import http from "./http";

class AuthService {
    baseEndpoint: string 

    constructor () {
        this.baseEndpoint = "auth/"
    }

    async authenticateUser(data: any) {
        return http.post(this.baseEndpoint, true, data )
    }
}

const authService = new AuthService()
export default authService
